import React, { useEffect, useMemo, useRef, useState } from 'react';
import { observer } from 'mobx-react';
import { Button, ConfigProvider } from 'antd';
import EasyForm from '@appen-china/easy-form';
import FramesApply, { FramesApplyType } from './FramesApply';
import Modal from '../../../common/modal/Modal';
import store from '../../store/RootStore';
import i18n from '../../locales';
import { setInitialValues } from '../../utils';
import { FrameAttributes } from '../../types';
import './AttributesModal.scss';

const FrameAttributesModal = observer(() => {
  const ref = useRef<HTMLDivElement>(null);
  const [applyType, setApplyType] = useState<FramesApplyType>();
  const [applyStart, setApplyStart] = useState<string>();
  const [applyEnd, setApplyEnd] = useState<string>();
  const appliedFrames = useRef<number[]>([]);
  const fieldFramesMap = useRef<{ [field: string]: number[] }>({});
  const fieldsWithValues = useMemo(() => {
    const { frameConfig, currentFrameAttributes } = store.frame;
    return setInitialValues(frameConfig?.fields || [], currentFrameAttributes);
  }, [store.config.frameAttributesModalVisible]);

  useEffect(() => {
    setApplyType(undefined);
    setApplyStart(undefined);
    setApplyEnd(undefined);
    appliedFrames.current = [];
    fieldFramesMap.current = {};
  }, [store.config.frameAttributesModalVisible]);

  const submit = () => {
    const buttons = ref.current?.querySelectorAll('button.easyform-btn.form-btn-submit');
    buttons?.forEach((btn) => {
      (btn as HTMLButtonElement).click();
    });
  };

  const onValuesSubmit = (values: any) => {
    const allApply = applyType !== undefined;
    const updatedFrameAttributes: FrameAttributes[] = [];
    const { attributes, currentCamera } = store.frame;
    const attributesCurrentCamera = attributes[currentCamera];
    const framesSet = new Set(Object.values(fieldFramesMap.current).map((f) => JSON.stringify(f)));
    if (allApply || framesSet.size <= 1) {
      // apply attributes together
      const frames = allApply
        ? appliedFrames.current
        : (Object.values(fieldFramesMap.current)[0] || [store.frame.currentFrame]);
      for (let i = 0; i < frames.length; i += 1) {
        updatedFrameAttributes.push({
          ...attributesCurrentCamera[frames[i]],
          frameIndex: frames[i],
          attributes: values,
        });
      }
    } else {
      // should set individual attribute by frame
      const fieldKeys = Object.keys(fieldFramesMap.current);
      const frames = Array.from(new Set(Object.values(fieldFramesMap.current).flatMap((fs) => fs)));
      for (let i = 0; i < frames.length; i += 1) {
        const frameIndex = frames[i];
        const attrs = { ...attributesCurrentCamera[frameIndex].attributes };
        for (let j = 0; j < fieldKeys.length; j += 1) {
          const key = fieldKeys[j];
          if (fieldFramesMap.current[key].includes(frameIndex)) {
            attrs[key] = values[key];
          }
        }
        updatedFrameAttributes.push({
          ...attributesCurrentCamera[frameIndex],
          frameIndex,
          attributes: attrs,
        });
      }
    }
    store.frame.setFrameAttributesForCamera(currentCamera, updatedFrameAttributes);
    store.config.setFrameAttributesModalVisible(false);
  };

  const { currentFrame, frameConfig, isSingleCamera, cameraNames, currentCamera } = store.frame;
  const { frameAttributesModalVisible, setFrameAttributesModalVisible } = store.config;
  if (!frameAttributesModalVisible) {
    return null;
  }
  return (
    <Modal
      visible
      draggable
      resizable
      defaultSize={{ w: 720, h: 720 }}
      closable={false}
      dragId="video-tracking-attributes"
      className="attributes-form"
      title={
        `${i18n.translate('FRAME_ATTRIBUTES')}${isSingleCamera ? '' : `-C${cameraNames.indexOf(currentCamera) + 1}`}-${i18n.translate('FRAME_ATTRIBUTES_FRAME', { values: { frame: currentFrame + 1 } })}`
      }
      onClose={() => setFrameAttributesModalVisible(false)}
      onMaskClick={submit}
    >
      <div ref={ref} className="attributes-form-content">
        <EasyForm
          theme="dark"
          fields={fieldsWithValues}
          conditions={frameConfig?.conditions}
          effects={frameConfig?.effects}
          rules={frameConfig?.rules}
          onSubmit={onValuesSubmit}
          renderLabel={(label, field) => (
            <div style={{ display: 'flex', justifyContent: 'space-between' }}>
              {label}
              {
                store.frame.frameCount > 1
                && (
                  <FramesApply
                    {...applyType && {
                      type: applyType,
                      start: applyStart,
                      end: applyEnd,
                    }}
                    onChange={(frames) => {
                      fieldFramesMap.current[field.name] = [...frames];
                    }}
                  />
                )
              }
            </div>
          )}
        />
      </div>
      <div className="attributes-form-footer">
        <ConfigProvider prefixCls="easyform">
          <Button type="primary" onClick={submit} style={{ marginRight: 16 }}>
            {i18n.translate('COMMON_SUBMIT')}
          </Button>
        </ConfigProvider>
        {
          store.frame.frameCount > 1 && store.frame.frameConfig
          && (
            <FramesApply
              text={i18n.translate('APPLY_FRAMES_TO_ALL')}
              onChange={(frames) => {
                appliedFrames.current = frames;
                setApplyStart(`${frames[0] + 1}`);
                setApplyEnd(`${frames[frames.length - 1] + 1}`);
              }}
              onTypeChange={(type) => {
                setApplyType(type);
              }}
            />
          )
        }
      </div>
    </Modal>
  );
});

export default FrameAttributesModal;
